Config.SecretDunData.data_dialogue = {
	[1001] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[世界上有五大本源元素，分别为水、火、风、光、暗。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[五大元素相生相克，由此衍生出了世间的万物。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[传说中最初的神也诞生于五大元素之中。]],20,250,90}}, answer={{1}}},
	[1002] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[在世界最初形成的时候，世界上只有一片大陆，四周被大海所环绕。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[但是曾经存在于大陆的神之间，发生了一场战争。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[元素之力冲撞产生的元素乱流，使得大陆四分五裂，也逐渐产生出独立于冒险大陆的时间与空间。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[我们现在所处的这个时空即是其中之一。]],20,250,90}}, answer={{1}}},
	[2001] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[冒险大陆的西南方因为常年有火山喷发，被称为炼狱之地。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[近来在大陆上肆虐的恶魔，便与这里突然诞生的迷雾有关。]],20,250,90}}, answer={{1}}},
	[2002] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[据说身处于迷雾中的生物，将会逐渐丧失理智，成为只有杀戮意识的怪物。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[而这迷雾，来自于一场恶魔的祭典。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[虽然祭典最终被伟大的先知所阻止，但迷雾依旧没有散去，炼狱之地也因此成了真正毫无生机的地方。]],20,250,90}}, answer={{1}}},
	[3001] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[矮人族是大陆上最擅长锻造的种族。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[矮人族的祖先居住在矿脉丰富的阿斯加德，也由此锻炼出了高超的锻造技艺。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[而矮人族最大的成就，莫过于传说中的五大神器。]],20,250,90}}, answer={{1}}},
	[3002] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[矮人族曾出现过一个锻造天才——伊瓦第。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[他掌握了被后世称为“元素锻造法”的锻造技巧，据说可以在锻造武器的过程中将元素之力融入其中。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[伊瓦第耗尽心血，利用五大元素锻造出了斧、拳、枪、弓、锤五大神器。]],20,250,90}}, answer={{1}}},
	[4001] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[先知与祭司，是冒险大陆上最为崇高的职业。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[他们都是天生拥有着些许神魂之力的人，也因此，他们注定拥有与平凡人类不同的一生。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[而其中最受万物敬仰的，当数伟大先知。]],20,250,90}}, answer={{1}}},
	[4002] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[传说中伟大先知是最接近于神的人类，拥有着预知未来的能力。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[也因此，伟大先知虔诚地信仰着光，甘愿为光奉献出自己的生命。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[而现在，这道光也将交由你们去传承。]],20,250,90}}, answer={{1}}},
	[5001] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[光与暗本是一体两面，有光出现的地方，角落里必定隐藏着暗。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[即使是神，也会拥有着暗的一面。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[强大如原初那位创造万物的伟大的神，也无法逃离心中的暗面。]],20,250,90}}, answer={{1}}},
	[5002] = {dialogue={{[[神秘老者]],0,0,[[gandaofu]],[[无人知晓黑暗之主从何而生，但连伟大先知亦无法消灭的生命，必定不是普通的存在。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[如果真的像伟大先知的预言一般，需要凝聚元素之心，方可驱逐黑暗。]],20,250,90},{[[神秘老者]],0,0,[[gandaofu]],[[那拯救大陆的路，可还长着呢……]],20,250,90}}, answer={{1}}}
}
