	[2] = {dialogue={{[[魂·洛基]],0,0,[[luoji]],[[没想到居然有人类敢闯入这个地方，想尝尝被烧成灰烬的滋味？]],300,250,65},{[[魂·洛基]],0,0,[[luoji]],[[不过就算你这样求我，也得你有足够的实力来到我面前啊~]],300,250,65}}},
