	[4] = {dialogue={{[[魂·神灵大祭司]],0,0,[[shenlingdajisi]],[[终于等到你了，冒险者。]],250,150,80},{[[魂·神灵大祭司]],0,0,[[shenlingdajisi]],[[如果你是预言中的驱逐黑暗之人，请你以真正的实力将我击败！]],250,150,80}}},
