	[2002] = {id=2002, btn_str="", res_id="board_img_1", title="告示牌", desc_1="位面之中矗立的木板，上面似乎记载着什么", desc_2="普罗米修斯以自身为形象创造出了最初的人类，他坚信智慧将会令人类拥有无限的可能。\n但如今的人类却仍旧无法凭借自己的能力生存，于是普罗米修斯为人类盗取火种。\n人类也由此学会了用火，真正拥有了生存的基础，以及文明发展的根本。"},
	[9901] = {id=9901, btn_str="复活", res_id="board_img_4", title="复活十字架", desc_1="蕴含神灵之力的十字架，虔诚的信仰可以沟通到神灵的伟力，其中似乎蕴含着永生的力量。", desc_2="可以随机复活一位已阵亡的英雄并回复其<div fontcolor=289b14>70%</div>的生命值，若当前无阵亡英雄则回复生命值最低的一位英雄<div fontcolor=289b14>100%</div>的生命。"},
	[9951] = {id=9951, btn_str="浸泡", res_id="board_img_7", title="回复泉水", desc_1="蕴含生命气息的泉水，即使相隔甚远依然能够感受到泉水所散发出的磅礴生机。", desc_2="浸泡泉水可使所有存活的英雄恢复<div fontcolor=289b14>30%</div>的生命值，泉水仅可使用一次。"},
	[3001] = {id=3001, btn_str="", res_id="board_img_1", title="告示牌", desc_1="位面之中矗立的木板，上面似乎记载着什么", desc_2="世界本源有五，分别为水、火、风、光、暗五大元素。\n风主传承，无数的生命借由风飞向远方，传播到另一片沃土之上。\n但当怨恨的种子在人心中生根发芽之时，风将会成为无形的利刃，隐匿于暗处，收割生命。"},
	[3002] = {id=3002, btn_str="", res_id="board_img_1", title="告示牌", desc_1="位面之中矗立的木板，上面似乎记载着什么", desc_2="亡灵收割者的称呼来自于他只将亡灵作为唯一的猎杀目标。\n怨恨会使人变得强大，在一切因亡灵侵袭而化为乌有之后，他的变化完美地验证着这句话。\n没有人知道他的力量从何而来，但复仇，已经成为了他活下去的唯一动力。"},
	[4001] = {id=4001, btn_str="", res_id="board_img_1", title="告示牌", desc_1="位面之中矗立的木板，上面似乎记载着什么", desc_2="世界本源有五，分别为水、火、风、光、暗五大元素。\n光主创造，万物向往着无尽的光，追寻着属于自己的方向。\n于是伟大先知集齐五大神器，建立先知殿，守卫冒险大陆的和平。在永夜降临之时又不惜献祭自己的生命，封印恶魔，留下预言。"},
	[4002] = {id=4002, btn_str="", res_id="board_img_1", title="告示牌", desc_1="位面之中矗立的木板，上面似乎记载着什么", desc_2="伟大先知虔诚地信仰着光，他坚信着光与暗存在都有其意义，但光永远比暗更胜一筹。\n于是他游历大陆，在先知能力的指引下终于寻得了五大神器，建立起以守卫大陆稳定为宗旨的先知殿。\n但他的心中隐隐不安，因为预言中大陆将会面临着灭亡的危机。\n“永夜将至，唯有异界之人，凝聚元素之心，方能驱逐黑暗，令希望重燃……”"},
	[5001] = {id=5001, btn_str="", res_id="board_img_1", title="告示牌", desc_1="位面之中矗立的木板，上面似乎记载着什么", desc_2="世界本源有五，分别为水、火、风、光、暗五大元素。\n暗主毁灭，诅咒在空间之中蔓延开来。\n在漫无边际的黑暗之中，万物的意志将会被不断侵蚀、腐化，直至成为行尸走肉的恶魔。\n冒险大陆的“永夜”也由此而来。"},
	[5002] = {id=5002, btn_str="", res_id="board_img_1", title="告示牌", desc_1="位面之中矗立的木板，上面似乎记载着什么", desc_2="黑暗之主隐藏于大陆的角落，开启“永夜祭典”，企图让世界陷入无尽的黑暗之中。\n但大陆西南方久久不散的迷雾引起了先知殿的怀疑，永夜祭典因为伟大先知的到来而中断。\n但人类的力量无法令黑暗之主消亡，伟大先知无奈之下以生命为代价，借助五大神器的力量构筑封印结界，将黑暗之主封印。"}
